import './App.css';
import React, {Component} from 'react';
import axios from 'axios'

class App extends Component{
  constructor(props){
    super(props)
  }

  componentDidMount(){
    axios.get('http://localhost:3010/api/test').then(response => {
      console.log(response)
    })
  }

  render(){
    return(
      <div className='App'>
        always good
      </div>
    )
  }
}


export default App;
